- input: "TEXT\x1CC00030718\x1C1\x1C\x1CF3XA\x1C11/19/10: This amendment corrects
    aggregate YTD calculations for the Foster, Calvert, Reichert, Kanjorski & Tiberi
    Schedule E transactions. For Line 21b of this report, the 10/6/10 disbursement
    to Thompson Communications Inc represents advance costs for independent expenditures
    that were not publicly disseminated during this reporting period, but instead
    will be disseminated in future reporting periods.  For the contra disbursement
    amounts reported on Line 21b and transferred to Line 24 of this report for Amplify
    Public Affairs LLC (Website Design/Production/Operation Costs totaling $38,500.00),
    Fenn Communications ($304,000 for TV ad costs & $100,000 for Internet ad costs),
    Peter D Hart Research ($26,150.00 for survey costs), Terris, Barnes & Walters
    ($366,563.00 for direct mail costs), and TargetSmart Communications ($9,610.00
    for mail list costs), the full purpose of disbursement should be noted as: Independent
    Expenditure disseminated, see Line 24 item. These amounts relate to advance costs
    for independent expenditures that were originally reported as positive entries
    on Line 21b of previous monthly reports (see our July, August, September, and
    October 2010 monthly reports).   For the Line 24 corresponding positive entries,
    the full purpose of disbursement for each is:  Transfer costs from Line 21b to
    Line 24 due to public dissemination of independent expenditure communication.
    \ Items are:  Amplify Public Affairs on 10/4/10 for website design/production/operation
    costs of $3,208.33 each for Ken Calvert, Dennis Cardoza, Ed Perlmutter, Johnny
    Isakson, Joe Donnelly, Richard Burr, John Adler, Pat Tiberi, Jim Gerlach, Paul
    Kanjorski, and Chet Edwards, and $3,208.37 for Dave Reichert;  Fenn Communications
    on 10/4/10 for TV ad costs of $304,000.00 for John Adler and on 10/4/10 for Internet
    ad costs of $100,000.00 for Bill Foster; Peter D Hart Research on 10/4/10 for
    survey costs of $26,150.00 for John Adler; Terris, Barnes & Walters on 10/4/10
    for direct mail costs of $366,563.00 for Paul Kanjorski; TargetSmart Communications
    on 10/4/10 for mail list costs of $9,610.00 for Paul Kanjorski.   For the contra
    disbursement entries for the National Association of Realtors that are reflected
    on Line 21b of this report on the dates of 10/4/10, 10/8/10, 10/11/10, 10/12/10
    & 10/13/10 and which total $4,900, with the explanation each is transferred to
    Line 24 of this report, the full purpose of disbursement should be noted as: Independent
    Expenditure disseminated, see Line 24 item.  These amounts relate to an original
    $6,900 advance payment made to the National Association of Realtors for consulting
    services on 9/13/10 & reported on Line 21b of the October 2010 monthly report.
    \ $4,900.00 is being utilized as consulting services attributable to independent
    expenditures in this period with the full purpose of disbursement for each positive
    entry for National Association of Realtors on Line 24 as: Transfer consulting
    services from Line 21b to Line 24 due to public dissemination of independent expenditure
    communications.   Line 24 entries are attributable as follows: $200.00 each on
    10/4/10 for Ken Calvert, Dennis Cardoza, Ed Perlmutter, Johnny Isakson, Joe Donnelly,
    Richard Burr, Pat Tiberi, Jim Gerlach, Chet Edwards, and Dave Reichert;  $600.00
    on 10/4/10 for Paul Kanjorski; $300.00 on 10/4/10 for John Adler;  $100.00 on
    10/4/10 for Bill Foster; $500.00 on 10/8/10 for Bill Foster; $200.00 on 10/11/10
    for John Adler; $100.00 each on 10/11/10 for Dennis Cardoza, Ed Perlmutter, and
    Joe Donnelly; $400.00 on 10/12/10 for John Adler; $200.00 each on 10/13/10 for
    Ken Calvert and Dave Reichert; $100.00 on 10/13/10 for Jim Gerlach.\n"
